import React from "react";
import "./Home.css";
import Workplace from "../Workplace/Workplace";
import add from "../assets/add.svg";
import bug from "../assets/bug.svg";
import add_circle from "../assets/add_circle.svg";
import { Pane, MoreIcon } from "evergreen-ui";

function Home() {
    return (
        <div>
            <Workplace />
            <div>
                <Pane className="workspace_container">
                    <h2>My First Workspace</h2>
                    <div>
                        <Pane className="space">
                            <MoreIcon className="moreicon" />
                            <img src={bug} alt="" height="35" width="35" />
                            <h4>Bug Tracking</h4>
                            <p className="">www.deskiapp.com</p>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas imperdiet velit</p>
                            <p>72%</p>
                        </Pane>
                        <Pane className="space"></Pane>
                        <Pane className="space">
                            <center>
                                <img src={add_circle} className="add_circle" alt="" height="22" width="22" />
                            </center>
                            <center>
                                <p className="add_space">Add Space</p>
                            </center>
                        </Pane>
                    </div>
                </Pane>
            </div>
            {/* <div className="add_workspace">
                <img src={add} alt="" height="10" width="10" />
            </div> */}
        </div>
    );
}

export default Home;
